import React from "react";

const KpiCards = ({ data }) => {
  return (
    <div className="kpi-cards">
      <div className="card">
        <p>Calories</p>
        <h3>{data.calorieCount} kcal</h3>
      </div>
      <div className="card">
        <p>Prot√©ines</p>
        <h3>{data.proteinCount} g</h3>
      </div>
      <div className="card">
        <p>Glucides</p>
        <h3>{data.carbohydrateCount} g</h3>
      </div>
      <div className="card">
        <p>Lipides</p>
        <h3>{data.lipidCount} g</h3>
      </div>
    </div>
  );
};

export default KpiCards;
